import React from 'react';

function App() {
  return (
    <div className='left-sidebar'>
      <h3 className='title'>coinbase</h3>
      <ul>
        <li className='asset'>Assets</li>
        <li className='trade'>Trade</li>
        <li className='pay'>Pay</li>
        <li className='for-you'>For You</li>
        <li className='learn-and-earn'>Learn and earn</li>
        <li className='notifications'>Notifications</li>
        <li className='invite-friends'>Invite Friends</li>
      </ul>
    </div>
  )
}

export default App;
